import React, {useState} from 'react';
import './App.css';

const Header = () => {
    return(
       <div className="header">
            {/*<h6>me header</h6>*/}
            <h1>Hello I'm a doc builder!</h1>

       </div>
    );
};
const Login = () => {
    return(
       <div className="login">
            <h6>me login</h6>
       </div>
    );
};
const Sidebar = () => {
    return(
       <div className="sidebar">
            Hello me sidebar<br/>
            Hello me sidebar<br/>
            Hello me sidebar
       </div>
    );
};
const Content = () => {
    return(
       <div className="content">
            <h6>me content</h6>
       </div>
    );
};

const Nav = () => {
    return(
       <div className="nav">
            <h6>me nav nav nav nav nav</h6>
       </div>
    );
};

export default function App() {
  return (
    <div className='wrapper'>
        <Header />
        <Login />
        <Sidebar />
        <Nav />
        <Content />
    </div>
  );
}
